import React from 'react';
import './adminpage.scss';
import { Layout, Menu, Breadcrumb } from 'antd';
import { ReactComponent as Logo } from '../media/logo.svg';
import { 
  DashboardIcon, 
  ClockIcon, 
  MessageIcon, 
  ProfileIcon, 
  ProjectIcon, 
  SearchIcon, 
  SettingIcon, 
  TodolistIcon,
  ArrowIcon
} from '../media/icons/index';
import {
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  UserOutlined,
  VideoCameraOutlined,
  UploadOutlined,
} from '@ant-design/icons';
import { CustomCollapse } from '../components';

const { Header, Content, Footer, Sider } = Layout;
const { SubMenu } = Menu;

export class AdminPage extends React.Component {
  state = {
    collapsed: false,
  };

  onCollapse = collapsed => {
    console.log(collapsed);
    this.setState({ collapsed });
  };

  render() {
    const { collapsed } = this.state;
    return (
      <Layout style={{ minHeight: '100vh' }}>
        <Sider trigger={<ArrowIcon/>} collapsible collapsed={collapsed} onCollapse={this.onCollapse} >
        <Logo className="logo" />
          <Menu theme="dark" defaultSelectedKeys={['1']} mode="inline">
            <Menu.Item key="1" icon={<DashboardIcon />}>
              Dashboard
            </Menu.Item>
            <Menu.Item key="2" icon={<ClockIcon />}>
              Messages
            </Menu.Item>
            <Menu.Item key="3" icon={<MessageIcon />}>
              To-do List
            </Menu.Item>
            <Menu.Item key="4" icon={<ProfileIcon />}>
              Profile
            </Menu.Item>
            <Menu.Item key="5" icon={<ProjectIcon />}>
              Realtime tracker
            </Menu.Item>
            <Menu.Item key="6" icon={<SettingIcon />}>
              Projects
            </Menu.Item>
            <Menu.Item key="7" icon={<TodolistIcon />}>
              Settings
            </Menu.Item>
          </Menu>
          <Footer>
            {/* {React.createElement(this.state.collapsed ? MenuUnfoldOutlined : ArrowIcon, {
              className: 'trigger',
              onClick: this.toggle,
            })} */}
          </Footer>
        </Sider>
        <Layout className="site-layout">
          <Header className="site-layout-background" style={{ padding: 0 }} />

          <Content style={{ margin: '0 16px' }}>
            <Breadcrumb style={{ margin: '16px 0' }}>
              <Breadcrumb.Item>User</Breadcrumb.Item>
              <Breadcrumb.Item>Bill</Breadcrumb.Item>
            </Breadcrumb>

            <div className="site-layout-background" style={{ padding: 24, minHeight: 360 }}>
              Bill is a cat.
            </div>
          </Content>

          <Footer style={{ textAlign: 'center' }}>Ant Design ©2018 Created by Ant UED</Footer>
        </Layout>
      </Layout>
    );
  }
}

export default AdminPage;
